question:
Let  $A=\left( \begin{array}{rrr}
1 & 2 & 0\\ 
1 & 0 & 2\\ 
0 & 1 & 1\end{array}
\right)$ and $g\left(x\right)=x^2-2x-3I_{3\times 3}$. Find $\mathrm{det} \left(g(A) \right)$.

Find the continuity points set of the function
$$f(x,y,z) = \begin{cases}
\left(1+ \frac{x^2+y^2}{z^2}\right)^{\frac{x^2}{x^2+y^2+z^2}} & \text{if } (x,y,z) \in \mathbb{R}^2\times\left(\mathbb{R}\setminus\{0\}\right) \\
\lambda & \text{if } (x,y,z) \in \mathbb{R}^2\times \{0\}
\end{cases}$$
where $\lambda\in\mathbb{R}$.

Find $a$ such that the matrix $\left( \begin{array}{rrr}
1 & 2 & 3 \\ 
4 & 5 & 6 \\ 
3 & 2 & a \end{array}
\right)$ is singular.
